import { Button} from 'react-bootstrap';
import '../css/GameComponents.css'

const Game = () => {
  const [board, setBoard] = useState(Array(9).fill(null))

  return (
    <div className='black_back'>
      <div className="board">
           {
               board.map((square, i) => (
                   <Button key={i} value={square} onClick={() => click(i)} />
               ))
           }
        </div>
    </div>
  );
}

export default Game;
